import React from 'react'
import styled from 'styled-components';

function NavPane() {
  const navPaneStyle = {
    float:"left",
    display: 'flex',
    backgroundColor: 'Grey',
    flexDirection: 'column',
    alignItems: 'stretch',
    width: '300px',
    maxWidth: '90%', 
    maxHeight: '90%',
    boxSizing: 'border-box',
    borderRadius:'20px',
    marginTop: '40px',
    paddingTop: '200px',
    paddingBottom: '50px',
    fontSize: '16px',
    boxShadow: '0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23)',
  }

  const buttonStyle={
    borderRadius:'0px',
    border:'none',
    color:'white',
    textAlign:'left',
    padding:'10px',
    fontSize:'15px',
    transition:'0.3s',
    outline:'none',
    backgroundColor:'red',
    cursor:'pointer',
  }

  const StyledButton = styled.a`
  border-radius: 0px;
  border: none;
  color: white;
  text-align: left;
  padding: 10px;
  font-size: 15px;
  transition: 0.5s;
  outline: none;
  background-color: red;
  cursor: pointer;
  &:active {
    transform: scale(0.95);
  }
`;
  return (
    <div style={navPaneStyle} class="nav flex-column">

      <StyledButton className="btn btn-block rounded-0" href="#">Active</StyledButton>
      <StyledButton className="btn btn-block rounded-0" href="#">Link</StyledButton>
      <StyledButton className="btn btn-block rounded-0" href="#">Link</StyledButton>
      <StyledButton className="btn btn-block rounded-0" href="#">Disabled</StyledButton>
    </div>
  )
}

export default NavPane
